import './Home.css';
import React from 'react';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import { Typography } from '@mui/material';



const Home= () =>  {
  return <>
  <Box>
    <Paper
    sx={{
      position:"relative",
      width:"340px",
      display:"flex",
      justifyContent:"space-between",
      mt:"22px",
      pt:"27px",
      pb:"7px",
    }}
   >
    <Typography sx={{ml:"16px"}}>
      GYM 
    </Typography>
    
    
    


    </Paper>
  </Box>
  
  </>
  
}

export default Home;
